import React from 'react';

const Home = () => {
    return (
        <div className="p-4">
            <h2 className="text-3xl font-bold mb-4">Welcome to Mickey Nails</h2>
            <p>
                Our qualified team provides a full range of nail design services to satisfy even the most demanding clients.
                With our help, you can easily acquire a new look for your nails to stand out from the crowd.
            </p>
        </div>
    );
};

export default Home;
